import * as React from "react";
import { ButtonGroup } from "@mui/material";
import { Checkbox } from "@mui/material";
import { TextField } from "@mui/material";
import './Stylesheets/LoginForm.css';
import { Stack, Paper, Grid, Button, Box, Typography, FormControlLabel } from "@mui/material";

function LoginForm(){
    const handleSubmit = (event) =>{
        event.preventDefault();
        const data = new FormData(event.currentTarget);
        console.log({
            email: data.get('email'),
            password: data.get('password'),
        });
        console.log("hejka");
    };


    return (<Box component="form" action="/auth" method="post" onSubmit={handleSubmit} sx={{mt:5}} gap={5} display="flex" flexDirection="column" justifyContent="center">
        <h1 className="LogoHeader">Epinote</h1>
        <TextField autofocus label="E-mail" name="email" id="email" sx={{mr:5, ml:5}} variant="standard" size="small"/>
        <Box sx={{mr:5, ml:5}}>
            <TextField fullWidth label="Password" name="password" id="password" type="password" variant="standard" size="small"/>
            <FormControlLabel control={<Checkbox size="small"/>} label="Remember Me"/>
        </Box>

        <Box sx={{mr:5, ml:5, mb:7}} display="flex" justifyContent="space-between" gap={5}> 
            <Button variant="text">Create Account</Button>
            <Button variant="contained" type="submit">Log In</Button>
        </Box>
        </Box>);
}

export default LoginForm;
